import java.util.TreeMap;
import java.util.HashMap;

public class Main {
    public static void main(String[] args) {
        TreeMap<String, Integer> map = new TreeMap<>();
        HashMap<String, Integer> hashMap = new HashMap<>();

        // Adding some unrelated operations to make the program more complex
        hashMap.put("tempKey", 100);
        int tempValue = hashMap.get("tempKey");
        System.out.println("Temp Value: " + tempValue);

        // Performing some operations on the TreeMap
        map.put("anotherKey", 200);
        int anotherValue = map.get("anotherKey");
        System.out.println("Another Value: " + anotherValue);

        /* write */ map.put("key", 42);

        // More unrelated operations
        for (int i = 0; i < 5; i++) {
            hashMap.put("key" + i, i * 10);
        }

        for (String key : hashMap.keySet()) {
            System.out.println("HashMap Key: " + key + ", Value: " + hashMap.get(key));
        }

        /* read */ Integer value = map.get("key");
        System.out.println("Main Value: " + value);

        // Additional operations on the TreeMap
        map.put("finalKey", 300);
        int finalValue = map.get("finalKey");
        System.out.println("Final Value: " + finalValue);
    }
}
